import logo from './logo.svg';
import './App.css';

function App() {
  const handleSubmit = () => {
    alert('Please include all required info asked above');
  };

  return (
    <div className="App">
      <h1 className="head">login</h1>

      <h4 className="n">NAME: </h4>
      <input type="text" id="nameInput" placeholder="Type your name here" /><br />

      <h4 className="n">AGE: </h4>
      <input type="text" id="ageInput" placeholder="Enter your age here" /><br />

      <h4 className="n">E-MAIL: </h4>
      <input type="text" id="emailInput" placeholder="Enter your email here" /><br />

      <button id="btn" onClick={handleSubmit}>Submit</button>

      <p id="output"></p>
    </div>
  );
}

export default App;
